import usePopulateOrdersSummary from './usePopulateOrdersSummary';
import usePopulateOrdersSellersMost from './usePopulateOrdersSellersMost';
import usePopulateOrdersProductsMost from './usePopulateOrdersProductsMost';
import usePopulateOrderProductPriceExpensive from './usePopulateOrderProductPriceExpensive';

// Import your child components
import OrdersSummary from './OrdersSummary';
import OrdersSellersMost from './OrdersSellersMost';
import OrdersProductsMost from './OrdersProductsMost';
import OrderProductPriceExpensive from './OrderProductPriceExpensive';

const populate = () =>{
  const queries = useQueries([
    {
      queryKey: 'populateOrdersSummary',
      queryFn: usePopulateOrdersSummary,
    },
    {
      queryKey: 'populateOrdersSellersMost',
      queryFn: usePopulateOrdersSellersMost,
    },
    {
      queryKey: 'populateOrdersProductsMost',
      queryFn: usePopulateOrdersProductsMost,
    },
    {
      queryKey: 'populateOrderProductPriceExpensive',
      queryFn: usePopulateOrderProductPriceExpensive,
    },
  ]);

  // You can access the data, error, isLoading, and isError states of each query
  // For example, queries[0].data is the data from usePopulateOrdersSummary
  // queries[1].error is the error from usePopulateOrdersSellersMost, and so on

  return (
    <div>
      {/* Render your child components and pass the query states as props */}
      <OrdersSummary data={queries[0].data} error={queries[0].error} isLoading={queries[0].isLoading} isError={queries[0].isError} />
      <OrdersSellersMost data={queries[1].data} error={queries[1].error} isLoading={queries[1].isLoading} isError={queries[1].isError} />
      <OrdersProductsMost data={queries[2].data} error={queries[2].error} isLoading={queries[2].isLoading} isError={queries[2].isError} />
      <OrderProductPriceExpensive data={queries[3].data} error={queries[3].error} isLoading={queries[3].isLoading} isError={queries[3].isError} />
    </div>
  );
}

export default populate;
